('2410','2','8359','Wohnung Jordi',Null,'Neu sanierte 2 Schlafzimmer Wohnung am Strand von Palma Nova','33860','Palma Nova liegt in der Gemeinde Calvia, im Südwesten Mallorcas. Die Wohnanlage befindet sich direkt am wunderschönen Sandstrand und an der Promenade von Palma Nova bestückt mit vielen Restaurants und Bars. Das Apartment wurde 2015 komplett saniert und befindet sich in der 4 Etage mit einem fantastischen Blick über den Strand aufs Meer. Die ca 75m² Wohnfläche verteilt sich auf Wohn-Esszimmer, 2 Schlafzimmer und 2 Badezimmer. Ausgestattet mit einer modernen weißen Küche, Waschmaschine, Spülmaschine, großen Backofen, Mikrowelle, Ceranfeld, gr. Kühlschrank und eleganten Möbeln, ist diese Wohnung die ideale Urlaubsimmobilie für 2-4 Personen, die die Strandnähe suchen. Eine ca 15m² große Terrasse rundet das Angebot ab. Die monatlichen Gemeinschaftskosten liegen bei ca 150€. Bei dieser Immobilie fallen für den Käufer zusätzlich zum Kaufpreis noch 15.000€ Makler Gebühren an','33861','450000','106','2015-12-09 13:04:34','106','2015-12-09 13:05:07',Null,'2536','106','1191',1,'1','0',Null,Null,Null,'33862',Null,'0','0','0',Null,'2015-12-09 13:25:06',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33863',Null,'33864',Null,'33865',Null,'33866','971 617144','33867','0',0,'0');
